package main

import (
	"fmt"
	"strings"
)

var lowerCase = []string{"a", "b", "c", "d", "e", "f", "g", "h", "i", "j", "k", "l", "m", "n", "o", "p", "q", "r", "s", "t", "u", "v", "w", "x", "y", "z"}

func performReduction(input string) int {
	currStr := input
	runAgain := true

	for runAgain {
		runAgain = false
		for i := len(currStr) - 2; i >= 0; i-- {
			if len(currStr) <= i+1 {
				continue
			}

			if currStr[i] != currStr[i+1] && strings.ToLower(string(currStr[i])) == strings.ToLower(string(currStr[i+1])) {
				//fmt.Printf("Converting %s to ", currStr)
				currStr = currStr[:i] + currStr[i+2:]
				//fmt.Printf("%s\n", currStr)
				runAgain = true
			}
		}
	}
	return len(currStr)
}

func removeLetter(currStr string, letter string) string {
	for i := len(currStr) - 1; i >= 0; i-- {
		if strings.ToLower(string(currStr[i])) == letter {
			currStr = currStr[:i] + currStr[i+1:]
		}
	}
	return currStr
}

func main() {
	smallestCount := 999999999

	for i := 0; i < 26; i++ {
		currStr := inputStr
		currStr = removeLetter(currStr, lowerCase[i])
		count := performReduction(currStr)
		if count < smallestCount {
			smallestCount = count
		}
		fmt.Printf("%s has count: %d\n", lowerCase[i], count)
	}

	fmt.Printf("Final string has length %d\n", smallestCount)
}

const (
	//inputStr = `dabAcCaCBAcCcaDA`
	inputStr = ``
)
